@MilesMcBain @EmRstats Happened to think about this the other week. A base #RStats solution:

both &lt;- function(...) {
  x &lt;- expand.grid(...)
  split(x, f = seq_len(nrow(x)))
}

for (iter in both(i = 1:3, j = 3:1)) with(iter, {
  message(sprintf("(i,j) = (%s,%s)", i, j))
})

